const storageName = 'platform-walkthrough'
const customCSS = `
  html {
    scroll-behavior: smooth;
  }

  .no-scroll {
    overflow-y: hidden;
    height: 100vh;
  }

  dialog {
    max-width: 100vw;
    box-sizing: border-box;
    font-family: 'GothamBook', Arial;
  }

  dialog * {
    white-space: wrap;
  }

  dialog.tooltip-custom {
    position: absolute;
    left: 0;
    top: 90%;
    height: auto;
    width: 400px;
    padding: 20px;
    background: #fff;
    box-shadow: 0 0 18px 5px rgba(0, 0, 0, 0.35);
    border-radius: 10px;
    border: 0;
    z-index: 999;
    margin-left: 0;
  }

  dialog::backdrop {
    background: rgba(0, 0, 0, 0.5);
  }

  dialog.tooltip-custom:after {
    content: '';
    position: absolute;
    top: -10px;
    left: 10px;
    width: 0;
    height: 0;
    border-width: 0 9px 10px 9px;
    border-color: transparent transparent #fff transparent;
    border-style: solid;
  }

  dialog.tooltip-custom p {
    font-size: 16px;
    color: #e6b017;
    text-align: center;
  }

  dialog.tooltip-custom .close-dialog {
    top: 5px;
    right: 5px;
    height: 20px;
    width: 20px;
  }

  dialog.tooltip-custom .next-dialog {
    border: 0;
    background: #e6b017;
    color: #000;
    margin-top: 16px;
    border-radius: 30px;
    padding: 5px 20px;
    font-size: 16px;
  }

  dialog.tooltip-custom .next-dialog span {
    color: #fff;
    margin-left: 5px;
  }

  dialog.tooltip-custom.favourite {
    top: 107%;
    left: 45px;
  }

  dialog.tooltip-custom.browse-live {
    left: unset;
    right: 70px;
    top: 400%;
  }

  dialog.tooltip-custom.watch-live {
    top: calc(100% + 255px);
    left: 50px;
  }

  dialog.tooltip-custom.set-reminder {
    top: calc(100% + 380px);
    left: 60%;
  }

  dialog.tooltip-custom.modal-reminder-press {
    width: 380px;
    top: 10px;
    left: 0;
  }

  dialog.tooltip-custom.modal-reminder-press:after {
    top: 80px;
    left: unset;
    right: -14px;
    transform: rotate(90deg);
  }

  dialog.tooltip-custom.my-account {
    left: unset;
    right: -80px;
  }

  dialog.tooltip-custom.my-account p {
    line-height: normal;
  }

  dialog.tooltip-custom.my-account:after {
    left: unset;
    right: 120px;
  }

  dialog.tooltip-custom.my-account-view {
    left: 0;
    top: 30%;
  }

  dialog.tooltip-custom.my-account-view:after {
    top: 30px;
    left: -14px;
    transform: rotate(-90deg);
  }

  dialog.welcome {
    position: relative;
    background: #e6b016;
    box-shadow: 0 0 18px 5px rgba(0, 0, 0, 0.35);
    border: 0;
    border-radius: 8px;
    width: 730px;
    max-width: 100vw;
    padding: 25px;
  }

  dialog .close-dialog {
    position: absolute;
    top: 20px;
    right: 20px;
    border: 0;
    border-radius: 50%;
    color: #000;
    height: 30px;
    width: 30px;
    background: red;
    color: #fff;
    display: flex;
    justify-content: center;
    align-items: center;
    opacity: 1;
  }

  dialog.welcome svg {
    width: 100%;
    height: auto;
  }

  dialog.welcome p {
    font-size: 16px;
  }

  dialog.welcome p {
    margin-bottom: 10px;
  }

  dialog.welcome .actions {
    width: 100%;
    display: flex;
    justify-content: space-between;
    align-items: center;
    margin-top: 20px;
  }

  dialog.welcome .actions .next-dialog {
    border-radius: 30px;
    border: 3px solid #e6b017;
    background: #fff;
    color: #000;
    padding: 5px 20px;
    font-size: 16px;
  }

  dialog.welcome .actions .skip-dialog {
    background: transparent;
    border: 0;
    font-size: 16px;
    color: rgba(0, 0, 0, 0.5);
  }
`
