const isAuthenticated = () => {
  const element = document.querySelector('.user-menu ul li[data-show-if-authenticated]')
  return !element
}

const injectStyle = css => {
  const styleElement = document.createElement('style')
  styleElement.textContent = css
  document.head.appendChild(styleElement)
}

const injectDialog = (parentSelector, dialogClass, dialogBody) => {
  const parent = document.querySelector(parentSelector)

  if (!parent) {
    console.error('Walkthrough injection failed: No parent element found', parentSelector)
    return
  }

  const avoidedParents = ['body', '.fancybox-inner']

  if (!avoidedParents.includes(parentSelector)) parent.style.position = 'relative'

  const tooltip = `<dialog class="${dialogClass}">${dialogBody}</dialog>`
  parent.innerHTML += tooltip
}

const setStep = step => window.localStorage.setItem(storageName, step)

const getStep = () => {
  const currentStep = window.localStorage.getItem(storageName)
  if (currentStep === null) setStep(0)

  return JSON.parse(currentStep || 0)
}

const closeDialog = async () => {
  const dialog = document.querySelector('dialog[open]')
  document.querySelector('body').classList.remove('no-scroll')
  if (!dialog) return
  await dialog.close()
}

const fancyBoxMutation = async (mutationsList, observer) => {
  for (const mutation of mutationsList) {
    if (mutation.type === 'childList') {
      await mutation.addedNodes.forEach(async node => {
        if (node.nodeType === Node.ELEMENT_NODE) {
          if (node.classList.contains('fancybox-wrap')) {
            await closeDialog()

            injectDialog('.fancybox-inner', 'tooltip-custom modal-reminder-press', stepEightContent)
            const modalReminderPressDialog = document.querySelector(
              'dialog.tooltip-custom.modal-reminder-press'
            )
            setStep(7)
            modalReminderPressDialog.show()

            const close = document.querySelector('.modal-reminder-press .close-dialog')
            close.addEventListener('click', event => {
              closeDialog()
              setStep(-1)
            })

            const reminderPress = document.querySelector('a[data-reminder-action="addRecord"]')
            reminderPress.addEventListener('click', event => {
              closeDialog()
              setStep(8)

              injectDialog(
                '.main-menu .user-menu li a[href="/en/my-account"]',
                'tooltip-custom my-account',
                stepNineContent
              )
              const myAccountDialog = document.querySelector('dialog.tooltip-custom.my-account')
              myAccountDialog.show()
            })

            observer.disconnect()
          }
        }
      })
    }
  }
}

const intializeWalkthrough = () => {
  const current = getStep()

  if (current < 0) {
    console.log('Platform walkthrough has been skipped')
    return
  }

  if (!isAuthenticated()) {
    console.log('Platform walkthrough has been skipped, unauthenticated user')
    return
  }

  // if we are on the tv section
  const showLiveTVSteps = window.location.pathname.includes('live-tv') && current < 4
  if (showLiveTVSteps) setStep(4)

  // if we are the my account section
  const showMyAccountSteps = window.location.pathname.includes('my-account') && current < 9
  if (showMyAccountSteps) setStep(9)

  injectStyle(customCSS)

  // Inject all the dialogs
  // 0. Welcome
  injectDialog('body', 'welcome', stepOneContent)
  const welcomeDialog = document.querySelector('dialog.welcome')

  // 1. Top nav tabs
  injectDialog('.main-menu ul li', 'tooltip-custom top-nav', stepTwoContent)
  const topNavDialog = document.querySelector('dialog.tooltip-custom.top-nav')

  // 2. Favourite content
  injectDialog('.general-asset-list:nth-child(4)', 'tooltip-custom favourite', stepThreeContent)
  const favouriteDialog = document.querySelector('dialog.tooltip-custom.favourite')

  // 3. TV Item
  injectDialog('.main-menu li:nth-child(2)', 'tooltip-custom tv-item', stepFourContent)
  const tvItemDialog = document.querySelector('dialog.tooltip-custom.tv-item')

  // 4. Browse Live
  injectDialog('.title', 'tooltip-custom browse-live', stepFiveContent)
  const browseLiveDialog = document.querySelector('dialog.tooltip-custom.browse-live')

  // 5. Watch live
  injectDialog('.title .row', 'tooltip-custom watch-live', stepSixContent)
  const watchLiveDialog = document.querySelector('dialog.tooltip-custom.watch-live')

  // 6. Set reminder
  const titleRow = document.querySelector('.title .row')
  const newElement = document.createElement('div')
  newElement.classList.add('set-reminder')
  titleRow.appendChild(newElement)
  injectDialog('.set-reminder', 'tooltip-custom set-reminder', stepSevenContent)
  const watchReminderDialog = document.querySelector('dialog.tooltip-custom.set-reminder')

  // 7. ModalReminderPress
  // handled in the mutation observer

  // 8. My Account
  injectDialog(
    '.main-menu .user-menu li a[href="/en/my-account"]',
    'tooltip-custom my-account',
    stepNineContent
  )
  const myAccountDialog = document.querySelector('dialog.tooltip-custom.my-account')

  // 9. My Account View
  injectDialog('.col-lg-10', 'tooltip-custom my-account-view', stepTenContent)
  const myAccountViewDialog = document.querySelector('dialog.tooltip-custom.my-account-view')

  // 10. Finish
  injectDialog('footer', 'welcome finish', stepElevenContent)
  const finishDialog = document.querySelector('dialog.welcome.finish')

  const showDialog = async () => {
    await closeDialog()

    switch (getStep()) {
      case 0:
        if (!welcomeDialog) break
        welcomeDialog.showModal()
        document.querySelector('body').classList.add('no-scroll')
        break
      case 1:
        if (!topNavDialog) break
        topNavDialog.show()
        topNavDialog.scrollIntoView({ block: 'end', behavior: 'smooth' })
        break
      case 2:
        if (!favouriteDialog) break
        const parent = document.querySelector('.general-asset-list:nth-child(4)')
        parent.style.zIndex = 1
        favouriteDialog.show()
        parent.scrollIntoView({ inline: 'center', behavior: 'smooth' })
        break
      case 3:
        if (!tvItemDialog) break
        tvItemDialog.show()
        tvItemDialog.scrollIntoView({ block: 'end', behavior: 'smooth' })
        break
      case 4:
        if (!browseLiveDialog) break
        browseLiveDialog.show()
        browseLiveDialog.scrollIntoView({ inline: 'center', behavior: 'smooth' })
        break
      case 5:
        if (!watchLiveDialog) break
        watchLiveDialog.show()
        break
      case 6:
        if (!watchReminderDialog) break
        watchReminderDialog.show()

        const observer = new MutationObserver(fancyBoxMutation)
        const observerConfig = { childList: true, subtree: true }
        observer.observe(document.body, observerConfig)

        break
      case 7:
        // nothing
        // step is only reached through the mutation observer
        break
      case 8:
        if (!myAccountDialog) break
        myAccountDialog.show()
        myAccountDialog.scrollIntoView({ block: 'end', behavior: 'smooth' })
        break
      case 9:
        if (!myAccountViewDialog) break
        myAccountViewDialog.show()
        break
      case 10:
        if (!finishDialog) break
        finishDialog.showModal()
        document.querySelector('body').classList.add('no-scroll')
        break
      default:
        // nothing
        break
    }
  }

  showDialog()

  // Event Listeners
  // 1. Close Buttons
  const closeButtons = document.querySelectorAll('[data-close-dialog]')
  closeButtons.forEach(close => {
    close.addEventListener('click', event => {
      closeDialog()
      setStep(-1)
    })
  })

  // 2. Next buttons
  const nextButtons = document.querySelectorAll('[data-next-dialog]')
  nextButtons.forEach(next => {
    next.addEventListener('click', async event => {
      setStep(getStep() + 1)
      await showDialog()
    })
  })
}

document.onreadystatechange = () => {
  if (document.readyState === 'complete') {
    intializeWalkthrough()
  }
}
